Dolley Madison: Americas First Lady

Biography Documentary hosted by David Ogden Stiers, published by PBS broadcasted as part of PBS American Experience series in 2010 - English narration


Information
------------------------------

Dolley Madison lived through the two wars that established the U.S., was friends with the first 12 Presidents, and watched America evolve from a struggling young republic to the first modern democracy in the world. She was nicknamed &quot;Queen Dolley,&quot; and when she died in 1849 at the age of 81 - one of the last remaining members of the founding generation - Washington City honored her with the largest state funeral the capital had ever seen for a woman.
Born in relative obscurity before the American Revolution, Dolley Madison became one of the most influential American women of the early nineteenth century. As the wife of the fourth president, James Madison, Dolley Madison played an important part in the political and social experiment that was the early American Republic. Long before women held any overt political power, Dolley used her unelected position to legitimize the nation's new capital, to create a political and social style for the new country and to give Americans a sense of their own national identity. 

A co-production with Twin Cities Public Television, Dolley Madison is produced by Middlemarch Films, whose previous productions include Liberty! The American Revolution, and Alexander Hamilton.

